import React from 'react';
import '../Styles/home.css';
import { Link } from 'react-router-dom';
import NavBar from '../components/NavBar';
import { Stack, Button, Typography, Grid } from '@mui/material';
import Container from '@mui/material/Container';
import Box from '@mui/material/Box';
import Divider from '@mui/material/Divider';
import CssBaseline from '@mui/material/CssBaseline';
import { ThemeProvider, createTheme } from '@mui/material/styles';
import NotificationsActiveIcon from '@mui/icons-material/NotificationsActive';
import TextField from '@mui/material/TextField';
import { useNavigate } from 'react-router-dom';
const mainTheme = createTheme({ palette: { mode: 'dark', }, });

const DetalhesJazigo = () => {
    const animal = {
      nome: 'Vasco',
      nascimento: '12/05/2010',
      especie: 'Espécie do Animal',
      proprietario: 'Proprietário do Animal',
      endereco: 'Endereço do Animal',
      ultimaVisita: '01/01/2023',
      dataEnterro: '01/02/2023',
      planoContratado: 'Plano Contratado',
      mensagemLapide: 'Mensagem na Lápide',
      imagemAnimal: 'url-da-imagem-do-animal',
    };
  
    const handleAgendarExumacao = () => {
      console.log('Agendar exumação');
    };
  
    const handlePersonalizarJazigo = () => {
      console.log('Personalizar jazigo');
    };
  
    const navigate = useNavigate();
    return (
      <Box display="flex" justifyContent="center" alignItems="center" minHeight="100vh">
        <Card>
          <Box p={2} textAlign="center">
            <Typography variant="h5" component="h1" gutterBottom>
              Detalhes do Jazigo
            </Typography>
            <Typography variant="body1" gutterBottom>
              Nome: {animal.nome}
            </Typography>
            <Typography variant="body1" gutterBottom>
              Nascimento: {animal.nascimento}
            </Typography>
            <Typography variant="body1" gutterBottom>
              Espécie: {animal.especie}
            </Typography>
            <Typography variant="body1" gutterBottom>
              Proprietário: {animal.proprietario}
            </Typography>
            <Typography variant="body1" gutterBottom>
              Endereço: {animal.endereco}
            </Typography>
            <Typography variant="body1" gutterBottom>
              Última Visita: {animal.ultimaVisita}
            </Typography>
            <Typography variant="body1" gutterBottom>
              Data de Enterro: {animal.dataEnterro}
            </Typography>
            <Typography variant="body1" gutterBottom>
              Plano Contratado: {animal.planoContratado}
            </Typography>
            <Typography variant="body1" gutterBottom>
              Mensagem na Lápide: {animal.mensagemLapide}
            </Typography>
            <img src={animal.imagemAnimal} alt="Imagem do Animal" />
            <Box mt={2}>
              <Button variant="contained" color="primary" onClick={handleAgendarExumacao}>
                Agendar exumação
              </Button>
              <Button variant="contained" color="secondary" onClick={handlePersonalizarJazigo}>
                Personalizar Jazigo
              </Button>
            </Box>
          </Box>
        </Card>
      </Box>
    );
  };
  
  export default DetalhesJazigo;
